const events = response.events;
let allCompetitors = [];
let allOdds = [];
const allGames = [];
let allTeams = [];

for (let i = 0; i < events.length; i++) {
    const games = events[i].competitions;
    for (let i = 0; i < games.length; i++) {
        const competitors = games[i].competitors;
        const odds = games[i].odds;
        for (let i = 0; i < odds.length; i++) {
            allOdds.push(odds[i]);
        }
        for (let i = 0; i < competitors.length; i++) {
            allCompetitors.push(competitors[i]);
            const team = competitors[i].team;
            allTeams.push(team);
        }
    }
}

// Split allCompetitors into 'game' objects every two indices
for (let i = 0; i < allCompetitors.length; i += 2) {
    const game = {
        competitor1: allCompetitors[i],
        competitor2: allCompetitors[i + 1],
        odds: allOdds[i / 2], // Adjust the odds index as needed
        teams: [allTeams[i], allTeams[i + 1]], // Include both teams in an array
    };
    allGames.push(game);
}

